def hospital_all_scores(hospitals):
	global measure_groups
	models = make_models()
	hscores = {}
	for h in hospitals:
		s = summary_score(h, hospitals, models)
		if s[0] != "No Score":
			hscores[h] = s
	for group in measure_groups:
		score_list = [hscores[h][1][group] if hscores[h][1][group] != "No Score" else 0 for h in hscores]
		OldMin = min(score_list)
		OldMax = max(score_list)
		NewMin = 0.
		NewMax = 10.
		for h in hscores:
			if hscores[h][1][group] == "No Score":
				continue
			hscores[h][1][group] =  ((( hscores[h][1][group] - OldMin ) * (NewMax - NewMin)) / (OldMax - OldMin)) + NewMin
	OldMin = min([hscores[h][0] for h in hscores])
	OldMax = max([hscores[h][0] for h in hscores])
	NewMin = 0.
	NewMax = 10.
	for h in hscores:
		#NewValue = (((OldValue - OldMin) * (NewMax - NewMin)) / (OldMax - OldMin)) + NewMin
		hscores[h][0] =  ((( hscores[h][0] - OldMin ) * (NewMax - NewMin)) / (OldMax - OldMin)) + NewMin
	return hscores

