def top_hospitals(hospitals):
	models = make_models()
	hscores = {}
	for h in hospitals:
		s = summary_score(h, hospitals, models)[0]
		if s != "No Score":
			hscores[h] = s
	OldMin = min(hscores.values())
	OldMax = max(hscores.values())
	NewMin = 0.
	NewMax = 10.
	for h in hscores:
		#NewValue = (((OldValue - OldMin) * (NewMax - NewMin)) / (OldMax - OldMin)) + NewMin
		hscores[h] =  ((( hscores[h] - OldMin ) * (NewMax - NewMin)) / (OldMax - OldMin)) + NewMin
	sorted_hscores = sorted(hscores.items(), key=operator.itemgetter(1))[::-1]
	for h in sorted_hscores[:50]:
		hospital_info = medicare_client.get("rbry-mqwu", where=f"hospital_name == \"{h[0]}\"", limit=1)
		print(h[0] + ": " + str(h[1]))


