def nearby_hospital_scores(location, hscores, googlemaps=True):
	global gmaps
	models = make_models()
	geo = gmaps.geocode(location)
	if googlemaps:
		nearby = gmaps.places(query="hospital", type='hospital', location=geo[0]["geometry"]["location"], language='en-US', radius=50000)
		for h in nearby["results"]:
			print(h["name"])
			hospital_info = medicare_client.get("rbry-mqwu", where=f"hospital_name LIKE \"{h['name'].upper()}\"", limit=1)
			if hospital_info and hospital_info[0]["hospital_name"] in hscores.keys():
				print(hospital_info[0]["hospital_name"])
				print("SUMMARY SCORE: " + str(hscores[hospital_info[0]["hospital_name"]]))
